import Courses from "../Home/Courses";
function Home(props) {
  let uri = document.getElementById("form1").value;
  let data_python = props.python_courses_data.filter(props.python_courses_data.title.indexOf(uri) > -1);
  let aws_data = props.aws_data.filter(props.aws_data.title.indexOf(uri) > -1);
  let data_science_data = props.data_science_data.filter(props.data_science_data.titleindexOf(uri) > -1);
  let draw_data = props.draw_data.filter(props.draw_data.titleindexOf(uri) > -1);
  let excel_data = props.excel_data.filter(props.excel_data.titleindexOf(uri) > -1);
  let web_data = props.web_data.filter(props.web_data.titleindexOf(uri) > -1);
  return (
    <Courses
      data_python={data_python}
      aws_data={aws_data}
      data_science_data={data_science_data}
      draw_data={draw_data}
      excel_data={excel_data}
      web_data={web_data}
    />
  );
}

export default Home;
